import { Button, Container, TextField } from "@mui/material";
import React from "react";
import { Link } from "react-router-dom";

export default function Login(){
 
    return(
        <Container component={"div"}>
            <h2 className="text-center mt-5" style={{color: "#5CB85C"}}> Sign In </h2>
            <form className="box d-flex justify-content-center align-items-center flex-column">
                <Link to='/signup' className="btn needAnAccount" style={{color:"#5CB85C"}}> Need An Account </Link>
                <TextField variant="outlined" label='email' id="email" sx={{height:"80px", mt:"40px", width:'50%' }}/>
                <TextField variant="outlined" type="password" label='password' id="password" sx={{height:"80px", mt:"20px", width:'50%' }}/>
                <Button className="btn" type='submit' >Login</Button>
            </form>
        </Container>
    )
}
